  [],\n\t\"revision_timestamp\": \"2015-05-06T23:19:58.357953\",\n\t\"name\": \"seawifs-deep-blue-aerosol-optical-depth-and-angstrom-exponent-level-2-data-v004\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The SeaWiFS Deep Blue (SWDB) Level 2 Product
  contains data corresponding to a single SeaWiFS swath using Deep Blue algorithm.
  There are about 15 Level 2 data files produced per day.  Each contains retrieved
  aerosol properties averaged to a resolution of 3x3 SeaWiFS pixels (13.5x13.5 km
  at the center of the swath given 4.5km SeaWiFS pixels). nnThe primary data parameters
  are aerosol optical thickness, Angstrom exponent, and single scattering albedo.nn(The
  Shortname for this product is SWDB_L2).nnParameters contained in the SeaWiFS Deep
  Blue (SWDB) data files include the following:nnVariable Name | Description |Unitsnaerosol_optical_thickness_550_land
  | aerosol optical thickness estimated at 550 nm over land | (unitless)naerosol_optical_thickness_550_land_ocean
  | aerosol optical thickness estimated at 550 nm over land and ocean | (unitless)naerosol_optical_thickness_550_land_ocean_best_estimate
  | best estimate of aerosol optical thickness estimated at 550 nm over land and ocean
  \  | (unitless)naerosol_optical_thickness_550_ocean | aerosol optical thickness
  estimated at 550 nm over ocean | (unitless)naerosol_optical_thickness_confidence_flag_land
  | aerosol optical thickness confidence flag over land    | (unitless)naerosol_optical_thickness_confidence_flag_land_ocean
  | aerosol optical thickness confidence flag over land and ocean | (unitless)naerosol_optical_thickness_confidence_flag_ocean
  | aerosol optical thickness confidence flag over ocean | (unitless)naerosol_optical_thickness_land
  | aerosol optical thickness at 412 nm, 490 nm, and 670 nm over land  | (unitless)naerosol_optical_thickness_ocean
  | aerosol optical thickness at 412 nm, 490 nm, and 670 nm over ocean | (unitless)nangstrom_exponent_confidence_flag_land
  | angstrom exponent confidence flag over land | (unitless)nangstrom_exponent_confidence_flag_land_ocean
  | angstrom exponent confidence flag over land and ocean | (unitless)nangstrom_exponent_confidence_flag_ocean
  | angstrom exponent confidence flag over ocean | (unitless)nangstrom_exponent_land
  | angstrom exponent over land as derived from aerosol optical thickness at 412 nm
  and 490 nm  | (unitless)nangstrom_exponent_land_ocean | angstrom exponent over land
  and ocean as derived from aerosol optical thickness at 412 nm and 490 nm  | (unitless)nangstrom_exponent_ocean
  | angstrom exponent over ocean as derived from aerosol optical thickness at 412
  nm and 490 nm  | (unitless)nnEnd of parameter information\",\n\t\"license_title\":
